import React from 'react';

function App() {
  return (
    <div style={{ padding: '20px', fontFamily: 'Arial, sans-serif' }}>
      <h1 style={{ color: '#667eea', fontSize: '2rem' }}>EmpowerHer</h1>
      <p>This is a test to see if React is working.</p>
      <div style={{ 
        background: 'linear-gradient(135deg, #667eea 0%, #764ba2 100%)',
        color: 'white',
        padding: '40px',
        borderRadius: '10px',
        textAlign: 'center',
        margin: '20px 0'
      }}>
        <h2>Hero Section Test</h2>
        <p>Empowering Women Through Skills, Mentorship, and Community Support</p>
      </div>
    </div>
  );
}

export default App;
